package iamprakash;
//import java.util.Scanner;
public class typecast {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
       
	//type casting
	    int num=(int)(6.34f);
	    System.out.println(num);
	//automatic type casting
	    int a=14;
	    byte b=(byte)a;
	    float c=(float)a;
	    double d=(double)a;
	    System.out.println("Type casting values are   \nint: "+a+"\nbyte: "+b+"\nfloat: "+c+"\ndouble: "+d);
	
	
	}

}
